import logo from './logo.svg';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { Layout } from './components/layout/Layout';
import Home from "./components/pages/home/Home";
import HomeTwo from "./components/pages/home2/HomeTwo";
import HomeThree from "./components/pages/home3/HomeThree";
import Register from "./components/pages/register/Register";
import Borrow from "./components/pages/borrow/Borrow";

import './App.css';

function App() {
  return (
    <BrowserRouter>
      <Routes>

        <Route path="/" element={<Home />} />

        <Route path="home2" element={<Layout/>}>
        <Route index element={<HomeTwo />} />
        </Route>

        <Route path={`/register/`} element={<Register />} />
        <Route path={`/borrow/`} element={<Borrow />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
